import React, { useState, useEffect } from "react";
import './myHistory.css';

global.historyFetch = true;

function MyHistory({ activeMenu }) {
    const [message, setMessage] = useState(null);
    const [historyData, setHistoryData] = useState(null);

    useEffect(() => {
      // global.historyFetch=true;
      console.log(global.historyFetch);
      try{
        fetch('http://localhost:3001/history')
        .then((res) => res.json())
        .then((data) => {
          setHistoryData(data.history);
          console.log(historyData);
        },[global.historyFetch]);
      }
      catch(err) {
        console.log(err);
      }
    }, [activeMenu==='my_']);


    if (activeMenu === "My_history") {
      return (
        <div>
            <h2>my history</h2>
            <div className="table-container">
            <table border={1}>
              <thead>
                <tr>
                  <th>category</th>
                  <th>search</th>
                  <th>result</th>
                </tr>
              </thead>
              <tbody>
                {historyData && historyData.forEach((item) => {
                  return(
                    <tr>
                      <td>{item.category}</td>
                      <td>{item.search}</td>
                      <td>{item.result}</td>
                    </tr>
                  )
                })}
              </tbody>
            </table>
          </div>
        </div>
        );
    }
}
export default MyHistory;
